import logo from './logo.svg';
import './App.css';
import Header from './Header'
import { BrowserRouter,Route } from 'react-router-dom'
import Login from './Login'
import Register from './Register';
import AddProduct from './AddProduct';



function App() {
  return (
    <div className="">

      <BrowserRouter>

        <Header />
        <Route path="/login">
            <Login />
        </Route>
        <Route path="/register">
            <Register />
        </Route>
        <Route path="/add">
            <AddProduct />
        </Route>


      </BrowserRouter>

    </div>
  );
}

export default App;
